(7, 5, 'EJDLGDHTP1FY', 'I sent btc from bitcoins.com to my goldtradebox.com wallet but it has not appeared yet. how long does it take? here is the receipt from bitcoins.com sending to goldtradebox.com.\r\n« previous\r\n1\r\nnext »\r\n\r\nDate\r\nReceived BTC\r\nSent BTC\r\nDescription\r\nDeposit Fee BTC\r\n \r\n02/01/2019 17:21 \r\n  \r\n0.03864492 \r\nSent to 3Qmt3MHHjRTFX57w5xFVzMnRbvSLD4sERr\r\ntxid 96fca93253e8fb6d146cd96dbc62487264b45a13c5402fac4636b5934896f561 \r\n\r\n \r\n02/01/2019 17:21 \r\n  \r\n0.00005 \r\nfee \r\n\r\n \r\n02/01/2019 17:13 \r\n0.04245563 \r\n  \r\nContact #36553087 release \r\n\r\n\r\n\r\nTotal Received BTC\r\nTotal Sent BTC\r\n\r\nTotal Deposit Fee BTC', 1, '2019-02-01 22:38:17', '2019-02-01 22:38:17'),
(8, 5, 'EJDLGDHTP1FY', 'Sorry for the delay we could  not fine your deposit request. please follow the right procedure by login \" Go-to Transaction -> Deposited Found -> Select Manual BTC. then input  your deposit amount in USD then click on Add Now\r\n\r\nOnce the page load up our BTC wallet address will be display, make the corresponding  payment and upload payment proof with an optional message.\r\nThen click on Submit Now.', 2, '2019-02-02 00:22:53', '2019-02-02 00:22:53'),
(9, 6, 'DK3UQYLH96GV', 'Hello...…  there is nothing on your website about having to pay for more signals nor was I told this in live chat. Live chat told me no fees. I would like to withdraw my earnings in order to continue investing but the minimum is $10000 and I am at $8081. Please consider lowering the minimum withdraw to $8000 …. at least this one time.', 1, '2019-02-12 21:11:29', '2019-02-12 21:11:29'),
