(11, 6, 'DK3UQYLH96GV', 'Our website does not charge fees.your trading signals is exhausted and requires upgrade.\r\nKindly purchase signals to continue trading.', 2, '2019-03-05 09:40:48', '2019-03-05 09:40:48'),
(12, 8, 'RSDUAUOVXK7Z', 'Just wondering when the next deposit will show in my account balance. It’s been awhile', 1, '2019-03-21 04:57:43', '2019-03-21 04:57:43'),
