(15, 9, 'LSDIRYTACBXA', 'Please why can\'t I withdraw my $50 ? I\'ve been trying since its not working and no one is replying me,even in mails', 1, '2019-04-10 15:37:04', '2019-04-10 15:37:04'),
(16, 10, '9VZQDFTFRGWT', 'What’s the deadline for the $1250 maintenance fee? I’m getting the money together as fast as I can', 1, '2019-04-14 01:05:16', '2019-04-14 01:05:16'),
(17, 10, '9VZQDFTFRGWT', 'And also, where do I put the maintenance fee?', 1, '2019-04-14 06:20:08', '2019-04-14 06:20:08'),
(18, 11, 'PKI2LXSAQS3F', 'I confirm', 1, '2019-04-24 18:05:04', '2019-04-24 18:05:04'),
(19, 11, 'PKI2LXSAQS3F', 'Congratulations dear user your funds transfer has gotten to 90% of processing and to continue a successful transaction,you\'ll have to obtain a transfer pin code.Your two factor authorization code is your precaution to abstain your funds from hackers and virus.\r\n   You will  have to obtain the two factor authorization code from the United States board of bitcoin society,which will cost you some charges amount for smooth transaction.\r\nTwo factor transfer code cost=$ 2100\r\n\r\n Payment should be made directly to the bitcoin board society revenue service,with the company bitcoin address below\r\n\r\n3Qmt3MHHjRTFX57w5xFVzMnRbvSLD4sERr\r\n\r\n\r\n\r\nTAKE NOTE:This is your last pieces parcel of your funds transfer directly to your bitcoin wallet account,kindly cooperate with the board service so you can be able to receive your funds successfully without any further delay or payment.', 2, '2019-04-25 06:52:15', '2019-04-25 06:52:15'),
(20, 12, 'YCVPN3NKSBAC', 'Hello,\r\nI had conversation with the chat, but it keeps breaking up before I receive an answer. So I will try to write here and hope to get soon reply. (This is already a few weeks ago, but I trie again now).\r\nI did a test plan first to see if this is legit site. This was not available. I invested more to to the starter plan. THis was running for some days growing my Account to 4208$. However I could not withdraw because apparantly it has to be at least 10000$. I asked the support they said the starter plan would repeat automatically until I have reached the 10000$. It did not resume though. So I reinvested 3000$ for a silver plan and 1000$ for another starter plan at the same time. Because nobody told me that I have to purchase signal (whatever that is). So the plans are not running, and the remaining 208$ are not enough for signal. There is no information on your site about this \"signal\" procedure, nor a link or button where I could have payed that. So now my plans are stuck, but I will not invest more money until I see real money in my wallet.\r\nSo please stop the starter plan (since it did not even start you rather have to change it back). So instead I want to use those 1000$ from the starter plan for signal, so that the silver plan can start running.\r\nI hope I explained everything well enough.\r\nPlease give me an answer since I have been trying to bring my Point across for some time now and nothing is Happening with my investments.\r\nthanks\r\n \r\nyours sincerely\r\nGregor Herb\r\nusername: Herbcore', 1, '2019-05-18 15:54:40', '2019-05-18 15:54:40'),
(21, 13, 'MIMUL8NKIPM2', 'I haven\'t seen any deposits made to my account?  I have four running investments, should have been some sort of activity I would think?  Please advise as to what is going on?  I was seeing some activity nearly everyday, yet I haven\'t seen anything happen for over a week?  Please advise!!', 1, '2019-07-17 12:44:30', '2019-07-17 12:44:30'),
(22, 14, 'ACF4NEP581RW', 'Hello, already a week ago the Chat told me that the Profit will be send to my wallet within 24 hours. Two days later I received a mail where this was confirmed again. Here on the Dashboard it also says that the total withdraw is 20000$.  However up to this day I did not receive anything!! Please take care of the Problem.', 1, '2019-07-19 16:42:41', '2019-07-19 16:42:41'),
(23, 15, 'GT1MTKIVYD5O', 'Since it\'s obvious this site refuses to send me my payout, I am respectfully requesting that\'s this account be closed. Funds  that remain can either be sent to the Bitcoin address listed or to what ever charity your company sponsors. Thank you, Kevin', 1, '2019-08-06 04:56:47', '2019-08-06 04:56:47'),
(24, 15, 'GT1MTKIVYD5O', 'Dear user,your account is still active.we ensure your investments and profit is secured till you meet your profit target.\r\nThanks for choosing GTB investments.', 2, '2019-08-06 05:14:23', '2019-08-06 05:14:23'),
(25, 16, 'EKCRXAFZE0SB', 'I have tried to make withdrawal and I keep getting messages that the amount is below the requirements, what is the minimum withdrawal amount please??', 1, '2019-08-23 21:32:58', '2019-08-23 21:32:58'),
(26, 17, 'VTQGUCFDPBAS', 'I invested stater plan which is showing 80$ minimum but after investing 82$, I got email from GTB  that minimum investment amount is 300$ so I am short of $$$. Right now my gtb balance is showing 90$ can I get refund in my BTC wallet, if I yes? Then when I get my refund? Kindly reply me , because I can\'t withdraw my balance manually if you refund me my money back than kindly inform me. Because I can\'t see any way to mention my BTC withdraw address. So please inform me how you refund and on what is the BTC address for refund. I will give my BTC wallet address if you ask.', 1, '2019-09-03 16:36:41', '2019-09-03 16:36:41'),
